checkTestCase :: [([Slot], [Slot], [Slot])] -> [Bool]
checkTestCase xs = map checkSingleTestCase xs

checkSingleTestCase :: ([Slot], [Slot], [Slot]) -> Bool
checkSingleTestCase testCase = (masterJudge s g == ans)
